    for i = 1, #data do
        local keyIndex = ((i-1) % #key) + 1
        local charByte = string.byte(data:sub(i,i))
        local keyByte = string.byte(key:sub(keyIndex,keyIndex))
        
        -- Manual XOR implementation
        local xorResult = 0
        for bit = 0, 7 do
            local charBit = (charByte >> bit) & 1
            local keyBit = (keyByte >> bit) & 1
            -- If bits are different, set the corresponding bit in result
            if charBit ~= keyBit then
                xorResult = xorResult | (1 << bit)
            end
        end
        
        result = result .. string.char(xorResult)
    end
    return result
end

